import React from "react";
import back_img from "../../../media/back_img.jpg";
import raccoon from "../../../media/raccoon.jpg";
import Loader from "../../Loader/Loader";

const ProfileInfo = (props) => {
    if(!props.profile){
        return <Loader/>
    }


    return (
    <div>
        <div>
            <img src={props.profile.photos.large}/>
        </div>
        <div>
            <div>About me: {props.profile.aboutMe}</div>
        </div>
        <div>
            <div>Job description: {props.profile.lookingForAJobDescription}</div>
        </div>
        <div>
            <ul>Contacts:
                <li>Facebook: {props.profile.contacts.facebook.toString()}</li>
                <li>Website: {props.profile.contacts.website.toString()}</li>
                <li>VK: {props.profile.contacts.vk}</li>
                <li>Twitter: {props.profile.contacts.twitter}</li>
                <li>Instagram: {props.profile.contacts.instagram}</li>
                <li>Youtube: {props.profile.contacts.youtube}</li>
                <li>GitHub: {props.profile.contacts.github}</li>
                <li>Link: {props.profile.contacts.mainLink}</li>
            </ul>
        </div>
    </div>
    )
}

export default ProfileInfo;
